import { Observable } from 'rxjs';
import { IContactRequest } from '../model/contact-request.model';
import { Web3FormsService } from './web3forms.service';

@Injectable({
    providedIn: 'root'
})
export class ContactService {

    constructor(private web3FormsService: Web3FormsService) {}

    submitContactForm(contact: IContactRequest): Observable<IContactRequest> {
        return this.web3FormsService.post(contact);
    }
}

import { HttpClient, HttpContext, HttpHeaders, HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable()
export class HttpBaseService {

    readonly headers = new HttpHeaders({ 'Content-Type': 'application/json' });

    constructor(private http: HttpClient) { }

    post<T>(url: string, body: any | null, options?: {
        headers?: HttpHeaders | {
            [header: string]: string | string[];
        };
        context?: HttpContext;
        observe?: 'body';
        params?: HttpParams | {
            [param: string]: string | number | boolean | ReadonlyArray<string | number | boolean>;
        };
        reportProgress?: boolean;
        responseType?: 'json';
        withCredentials?: boolean;
    }): Observable<T> {
        return this.http.post<T>(url, body, {
            ...options,
            headers: this.headers,
        });
    }
}

import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { environment } from 'src/environments/environment';
import { HttpBaseService } from '../../core/services/http-base.service';
import { IContactRequest } from '../model/contact-request.model';

@Injectable({
    providedIn: 'root'
})
export class Web3FormsService {

    constructor(private httpBaseService: HttpBaseService) { }

    post(contact: IContactRequest): Observable<IContactRequest> {
        contact.access_key = environment.web3FormsApiKey;
        return this.httpBaseService.post<IContactRequest>(environment.web3FormsUrl, contact);
    }
}

